  state = {
    selectedItemId: 3
  }

  onItemSelected = (id) => {
    this.setState({selectedItemId: id})
  }

  render() {
    

    return <StarshipsList onItemSelected={this.onItemSelected}/>
    

  }
}


export default StarshipsPage
